INSERT INTO `kpi` (`id`, `kpi_id`, `short_name`, `indicator_statement`, `description`, `computation`, `data_sources`, `frequency`, `subject_area`, `current_target`, `is_cumulative`) VALUES
(306, 'KPI-11', 'TWGs meetings held in the month', 'Proportion of the Technical Working Group meetings holding monthly meetings', 'The indicator measures the percentage of TWGs that held the monthly meetings ', 'Numerator: Number of TWGs monthly meetings held in a specified period. Denominator: Number of TWGs monthly meetings expected in a specified period', 'TWG Minutes', 'Monthly', 5, 100, 0),
(307, 'KPI-12', 'HPAC meetings held in the month', 'Proportion of the Health Policy Advisory Committee (HPAC) monthly meetings held ', 'The indicator measures the percentage of HPAC monthly meetings held. HPAC meetings are held at least once a month', 'Numerator: Number of HPAC monthly meetings held in a specified period. Denominator: Number of months in the specific period', 'HPAC Minutes ', 'Monthly', 5, 100, 0),
(309, 'KPI-13', 'TMC meetings held in the month', 'Proportion of Top Management Committee (TMC) meetings held', 'The indicator measures the percentage of TMC meetings held.', 'Numerator: Number of TMC meetings in a specified period Denominator: Number of months in the specific period ', 'Minutes', 'Monthly', 5, 100, 0),
(310, 'KPI-14', 'Dept meeting held in the month', 'Proportion of departmental meetings held', 'The indicator measures the percentage of monthly departmental meetings held.  Each department is expected to hold at least one meeting a month.', 'Numerator: Number of departmental meetings held meetings in a specified period Denominator: Number of departmental meetings expected in a specified period', 'Meeting Minutes', 'Monthly', 5, 100, 0),
(311, 'KPI-15', 'Hospitals with functional BoD', 'Proportion of referral hospitals with functional hospital boards', 'This indicator measures the percentage of Referral Hospitals (Regional and National) with functional hospital boards.  A functional hospital board is one that is fully appointed, meets periodically (at least Quarterly) and meeting minutes available for the quarterly meetings.', 'Numerator: Number of Referral Hospitals with functional hospital boards. Denominator: Number of Referral Hospitals.', 'Hospital Board Guidelines, Board Committee File, Board Minutes ', 'Quarterly', 5, 100, 0),
(312, 'KPI-16', 'Depts timely submitting performance reports', 'Proportion of MoH Departments that submit performance reports on time', 'This indicator measures the percentage of MoH Departments that submit quarterly performance reports in time(One month following completion of the quarter).', 'Numerator: Number of MoH Departments that submit performance reports in time. Denominator: Number of MoH Departments.', 'Departmental plans and performance reports', 'Quarterly', 5, 100, 0),
(313, 'KPI-17', 'Projects timely submitting reports', 'Proportion of MoH project that submit project reports on time', 'This indicator measures the percentage of MoH project that submit progress reports in time (One month following completion of the quarter).', 'Numerator: Number of MoH project that submit progress reports in time. Denominator: Number of MoH project with due reports.', 'Project plans, progress reports', 'Quarterly', 5, 100, 0),
(314, 'KPI-18', 'Integrated support supervision visists performed', 'Number of integrated support supervision field visits to RRHs and Districts conducted quarterly ', 'This indicator counts the number of integrated support supervision visits to the RRHs and Districts that were conducted during the Quarter. At least one visit should be conducted', 'Absolute count ', 'Support supervision plans and reports', 'Quarterly', 5, 100, 0),
(315, 'KPI-19', 'Submission of weekly surveillance reports', 'Proportion of weekly surveillance reports submitted on time', 'This indicator measures the percentage of weekly surveillance reports that are submitted on time (as flagged in the DHIS2) by facilities', 'Numerator: Number of facilities submitting the weekly surveillance reports on time\r\n\r\nDenominator: Total of facilities expected to submit weekly surveillance reports\r\n', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(316, 'KPI-20', 'District submission of HMIS reports on time', 'Proportion of districts submitting  HMIS monthly reports on time. ', 'This indicator measures the percentage of districts that have submitted on time (as flagged in the DHIS2) at least ', 'Numerator: Number of districts submitting  HMIS monthly reports on time', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(317, 'KPI-21', 'Completeness of monthly HMIS reports', 'Completeness of monthly HMIS Reports', 'This indicator measures how many facilities in the country submitted monthly HMIS reports as flagged in the DHIS2 system', 'Numerator: Number of facilities that submitted monthly HMIS reports\r\n\r\nDenominator: Number of facilities expected to submit monthly HMIS reports\r\n', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(318, 'KPI-22', 'Facilities with functional X-ray machine', 'Proportion of facilities with functional X-ray machines', 'This indicator measures the percentage of hospitals (general, regional and national) with functional X-ray machine', 'Numerator: Number of hospitals with a functional X-ray machine.\r\nDenominator: Number of Hospitals.', 'Health Infrastructure Department Medical Equipment assessment reports', 'Quarterly', 7, 90, 0),
(325, 'KPI-23', 'Facilities with functional ultrasound machines', 'Proportion of health facilities with functional ultrasound machines', 'This indicator measures the percentage of health facilities with functional ultrasound machine disaggregated by level (HC IV, general, regional and national hospitals)', 'Numerator: Number of health facilities (HC IV, general, regional, and national) with a functional ultrasound machine.\r\nDenominator: Number of health facilities (HC IV, general, regional, and national', 'Health Infrastructure Department Medical Equipment assessment reports', 'Quarterly', 7, 65, 0),
(326, 'KPI-24', 'Infrastructure development projects executed as planned ', 'Proportion of MoH infrastructure development projects executed as planned within the financial year', 'This indicator measures the percentage of MoH infrastructure development projects executed as planned within the financial year', 'Numerator: Number of MoH development projects executed as planned.\r\nDenominator: Number of planned MoH development projects', 'Infrastructure development plans and tracker from MoH/PDU', 'Quarterly', 7, 90, 0),
(327, 'KPI-28', 'Malaria Positivity Rate', 'Patients diagnosed with Malaria that are laboratory confirmed', 'The KPI measure the proportion of patients tested for malaria that actually test positive', 'Numerator: Cases the have tested positive for malaria using\r\n\r\nDenominator: All cases tested for malaria', 'DHIS2', 'Quarterly', 11, 7, 0),
(328, 'KPI-29', 'Proportion of skilled births', 'Proportion of skilled births that occurred during the month', 'The indicator measure the proportion of births per district that are attended to by a skilled health worker', 'Numerator: Number of births that occurred in the health facility during the month within the district\r\n\r\nDenominator: Monthly Population estimated per district as projected by UBOS * 0.0485', 'DHIS2 and UBOS Website', 'Monthly', 11, 85, 0),
(329, 'KPI-30', 'Perinatal deaths audited', 'Proportion of perinatal deaths that have been audited', 'The indicator measures the proportion of perinatal deaths in a given facility during the month that have been audited', 'Numerator: Number of perinatal deaths audited during the month\r\nDenominator: Sum of fresh still births, macerated fresh still births and new born deaths during the month', 'DHIS2', 'Monthly', 11, 90, 0),
(330, 'KPI-31', 'Proportion of fresh still births', 'Proportion of fresh still births that have occurred', 'The indicator measures the proportion of child deaths at delivery that are fresh still births', 'Numerator: Number of fresh still births during the month\r\nDenominator: Sum of macerated fresh still births, newborn deaths and fresh still births during the month', 'DHIS2', 'Monthly', 11, 5, 0),
(333, 'KPI-01', 'Budget Absorption Rate', 'Overall percentage of expenditure for funds released. ', 'The indicator measures the percentage of funds released to a vote that are spent within the quarter. Votes in scope are: MoH, Department, Program, Project.  \r\nPossible dimensions include source of funding \r\n', 'Numerator: Amount spent by the vote as at the end of a given completed quarter (X) Denominator: Amount released to a vote as at the end of a given completed quarter (Y) Computation will be: (X/Y) *100', 'IFMS, PBS, Assistant Commissioner Account MoH', 'Monthly', 1, 90, 0),
(334, 'KPI-02', 'Transfer of subvention funds', 'Percentage of subvention funds transferred to affiliate institutions in time.', 'The indicator measures the percentage of subvention funds that were transferred to MoH affiliate institutions in time within 3 weeks of warrant approval. Subvention refers to a grant of money in aid or support, mostly by the government.', 'Numerator: Subvention funds transferred (X) Denominator: Total subvention funds received by the MoH (Y) (X/Y) *100', 'IFMS PBS Assistant Commissioner Account MoH', 'Quarterly', 1, 90, 0),
(335, 'KPI-03', 'Advances Accountability', 'Percentage of advances accounted in time. ', 'The indicator measures the percentage of subvention funds that were transferred to MoH affiliate institutions in time within 3 weeks of warrant approval. Subvention refers to a grant of money in aid or support, mostly by the government.', 'Numerator: Subvention funds transferred (X) Denominator: Total subvention funds received by the MoH (Y) (X/Y) *100', 'IFMS, PBS  Responsible Officer(s): Assistant Commissioner/ Account MoH', 'Quarterly', 1, 100, 0),
(336, 'KPI-04', 'Budget performance reports submitted timely', 'Percentage of quarterly budget performance reports (PBS) submitted on time.', 'The indicator measures the percentage of quarterly reports that are submitted on time (due 30th day of the 1st Month of the following Quarter). This refers to submission of quarterly PBS reports to MoFPED.', 'Numerator: Number of financial reports that are submitted Denominator: Number of Expected quarterly financial reports  Computation will be: (X/Y)', 'PBS', 'Quarterly', 1, 100, 0),
(337, 'KPI-06A', 'Procurements initiated on time', 'Percentage of procurements initiated in time.', 'The indicator measures the percentage of procurements that were initiated in time.', 'Numerator: Number of procurements initiated in time. \r\nDenominator: Number of procurements initiated.\r\n', 'Procurement plan and tracker from MoH PDU.', 'Quarterly', 2, 80, 0),
(338, 'KPI-06B', 'Procurements successfully completed in time.', 'The indicator measures the percentage of procurements that are completed successfully in time.', 'The indicator measures the percentage of procurements that are completed successfully in time.', 'Numerator: Number of procurements successfully completed in time.  Denominator: Number of expected procurements to be completed.', 'Procurement plan and tracker from MoH PDU.', 'Quarterly', 2, 80, 0),
(339, 'KPI-07', 'MoH filled positions', 'Percentage of approved positions filled in the MoH HQ structure ', 'The indicator measures the percentage of approved positions at the MoH HQ that are filled in the reporting year', 'Numerator: Number of approved positions filled at the MoH HQ structure in the year\r\nDenominator: Total number of approved positions at the MoH HQ structure in the year', 'iHRIS, HR Department', 'Monthly', 3, 85, 0),
(340, 'KPI-08', 'Wage absorption rate', 'Wage absorption rate', 'This refers to the extent to which the wage released for settling salaries of government health workers has been utilized in a given financial quarter', 'Numerator: Wage utilized for settling salaries of government health workers in each financial quarter. Denominator: Wage released for settling salaries of government health workers in a given financial quarter', 'IFMS, PBS, Assistant Commissioner/ Account MoH', 'Quarterly', 3, 100, 0),
(341, 'KPI-09', 'Stock status reports presented to HPAC', 'Proportion of bimonthly stock status reports compiled and presented to HPAC', 'This indicator measures the percentage of bi monthly stock status reports compiled and submitted to HPAC', 'Numerator: Number of stock status reports compiled and presented to HPAC in a quarter\r\nDenominator: Expected quarterly stock status reports', 'HPAC Meeting minutes C/o Department of Pharmaceuticals and Natural Medicines', 'Quarterly', 4, 100, 0),
(342, 'KPI-10', 'Facilities with functional eLMIS', 'Proportion of health facilities with a functional eLMIS', 'This indicator measures the percentage of the hospitals with a functional eLMIS.  Functionality:\r\n• Availability of equipment\r\n• Trained personnel\r\n• Completeness of reports\r\nCurrently this is only available at the district hospitals and above, at the lower facilities the capacity building is ongoing', 'Numerator: Number of facilities with a functional eLMIS\r\nDenominator: Total number of facilities', 'Functionality assessment report (C/o Department of Pharmaceuticals and Natural Medicines)', 'Quarterly', 4, 65, 0);
INSERT INTO `kpi_bkp` (`id`, `kpi_id`, `short_name`, `indicator_statement`, `description`, `computation`, `data_sources`, `frequency`, `subject_area`, `current_target`, `is_cumulative`) VALUES
(1, 'KPI-01', 'Finance Absorption Rate', 'Percentage of expenditure for funds released (absorption rate) (Cumulative)', 'The indicator measures the percentage of funds released to a vote that are spent within the quarter. Votes in scope are: MoH, Department, Program, Project.  \r\nPossible dimensions include source of funding \r\n', 'Numerator: Amount spent by the vote as at the end of a given completed quarter (X) Denominator: Amount released to a vote as at the end of a given completed quarter (Y) Computation will be: (X/Y) *100', 'IFMS, PBS, Assistant Commissioner Account MoH', 'Monthly', 1, 90, 0),
(2, 'KPI-02', 'Tranfer of subvention funds', 'Percentage of subvention funds transferred to affiliate institutions in time. (Cumulative)', 'The indicator measures the percentage of subvention funds that were transferred to MoH affiliate institutions in time within 3 weeks of warrant approval. Subvention refers to a grant of money in aid or support, mostly by the government.', 'Numerator: Subvention funds transferred (X) Denominator: Total subvention funds received by the MoH (Y) (X/Y) *100', 'IFMS PBS Assistant Commissioner Account MoH', 'Quarterly', 1, 80, 0),
(3, 'KPI-08', 'Wage absorption rate', 'Wage absorption rate', 'This refers to the extent to which the wage released for settling salaries of government health workers has been utilized in a given financial quarter', 'Numerator: Wage utilized for settling salaries of government health workers in each financial quarter. Denominator: Wage released for settling salaries of government health workers in a given financial quarter', 'IFMS, PBS, Assistant Commissioner/ Account MoH', 'Quarterly', 3, 100, 0),
(5, 'KPI-16', 'Depts timely submitting performance reports', 'Proportion of MoH Departments that submit performance reports on time', 'This indicator measures the percentage of MoH Departments that submit quarterly performance reports in time(One month following completion of the quarter).', 'Numerator: Number of MoH Departments that submit performance reports in time. Denominator: Number of MoH Departments.', 'Departmental plans and performance reports', 'Quarterly', 5, 100, 0),
(6, 'KPI-06A', 'Procurements initiated on time', 'Percentage of procurements initiated in time.', 'The indicator measures the percentage of procurements that were initiated in time.', 'Numerator: Number of procurements initiated in time. \r\nDenominator: Number of procurements initiated.\r\n', 'Procurement plan and tracker from MoH PDU.', 'Quarterly', 2, 80, 0),
(7, 'KPI-15', 'Hospitals with functional BoD', 'Proportion of referral hospitals with functional hospital boards', 'This indicator measures the percentage of Referral Hospitals (Regional and National) with functional hospital boards.  A functional hospital board is one that is fully appointed, meets periodically (at least Quarterly) and meeting minutes available for the quarterly meetings.', 'Numerator: Number of Referral Hospitals with functional hospital boards. Denominator: Number of Referral Hospitals.', 'Hospital Board Guidelines, Board Committee File, Board Minutes ', 'Quarterly', 5, 100, 0),
(8, 'KPI-03', 'Advances Accountability', 'Percentage of advances accounted in time. (Cumulative)', 'The indicator measures the percentage of subvention funds that were transferred to MoH affiliate institutions in time within 3 weeks of warrant approval. Subvention refers to a grant of money in aid or support, mostly by the government.', 'Numerator: Subvention funds transferred (X) Denominator: Total subvention funds received by the MoH (Y) (X/Y) *100', 'IFMS, PBS  Responsible Officer(s): Assistant Commissioner/ Account MoH', 'Quarterly', 1, 80, 0),
(9, 'KPI-14', 'Dept meeting held in the month', 'Proportion of departmental meetings held', 'The indicator measures the percentage of monthly departmental meetings held.  Each department is expected to hold at least one meeting a month.', 'Numerator: Number of departmental meetings held meetings in a specified period Denominator: Number of departmental meetings expected in a specified period', 'Meeting Minutes', 'Monthly', 5, 100, 0),
(10, 'KPI-13', 'TMC meetings held in the month', 'Proportion of Top Management Committee (TMC) meetings held', 'The indicator measures the percentage of TMC meetings held.', 'Numerator: Number of TMC meetings in a specified period Denominator: Number of months in the specific period ', 'Minutes', 'Monthly', 5, 100, 0),
(11, 'KPI-12', 'HPAC meetings held in the month', 'Proportion of the Health Policy Advisory Committee (HPAC) monthly meetings held ', 'The indicator measures the percentage of HPAC monthly meetings held. HPAC meetings are held at least once a month', 'Numerator: Number of HPAC monthly meetings held in a specified period. Denominator: Number of months in the specific period', 'HPAC Minutes ', 'Monthly', 5, 100, 0),
(12, 'KPI-11', 'TWGs meetings held in the month', 'Proportion of the Technical Working Group meetings holding monthly meetings', 'The indicator measures the percentage of TWGs that held the monthly meetings ', 'Numerator: Number of TWGs monthly meetings held in a specified period. Denominator: Number of TWGs monthly meetings expected in a specified period', 'TWG Minutes', 'Monthly', 5, 100, 0),
(13, 'KPI-17', 'Projects timely submitting reports', 'Proportion of MoH project that submit project reports on time', 'This indicator measures the percentage of MoH project that submit progress reports in time (One month following completion of the quarter).', 'Numerator: Number of MoH project that submit progress reports in time. Denominator: Number of MoH project with due reports.', 'Project plans, progress reports', 'Quarterly', 5, 100, 0),
(14, 'KPI-18', 'Integrated support supervision visists performed', 'Number of integrated support supervision field visits to RRHs and Districts conducted quarterly ', 'This indicator counts the number of integrated support supervision visits to the RRHs and Districts that were conducted during the Quarter. At least one visit should be conducted', 'Absolute count ', 'Support supervision plans and reports', 'Quarterly', 5, 100, 0),
(15, 'KPI-04', 'Financial reports submitted timely', 'Percentage of quarterly financial reports (PBS) submitted on time.', 'The indicator measures the percentage of quarterly reports that are submitted on time (due 30th day of the 1st Month of the following Quarter). This refers to submission of quarterly PBS reports to MoFPED.', 'Numerator: Number of financial reports that are submitted Denominator: Number of Expected quarterly financial reports  Computation will be: (X/Y)', 'PBS', 'Quarterly', 1, 100, 0),
(17, 'KPI-06B', 'Procurements successfully completed in time.', 'The indicator measures the percentage of procurements that are completed successfully in time.', 'The indicator measures the percentage of procurements that are completed successfully in time.', 'Numerator: Number of procurements successfully completed in time.  Denominator: Number of expected procurements to be completed.', 'Procurement plan and tracker from MoH PDU.', 'Quarterly', 2, 80, 0),
(18, 'KPI-19', 'Submission of weekly surveillance reports', 'Proportion of weekly surveillance reports submitted on time', 'This indicator measures the percentage of weekly surveillance reports that are submitted on time (as flagged in the DHIS2) by facilities', 'Numerator: Number of facilities submitting the weekly surveillance reports on time\r\n\r\nDenominator: Total of facilities expected to submit weekly surveillance reports\r\n', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(19, 'KPI-20', 'District submission of HMIS reports on time', 'Proportion of districts submitting  HMIS monthly reports on time. ', 'This indicator measures the percentage of districts that have submitted on time (as flagged in the DHIS2) at least ', 'Numerator: Number of districts submitting  HMIS monthly reports on time', 'DHIS2/HMIS', 'Monthly', 6, 100, 0),
(20, 'KPI-21', 'Completeness of monthly HMIS reports', 'Completeness of monthly HMIS Reports', 'This indicator measures how many facilities in the country submitted monthly HMIS reports as flagged in the DHIS2 system', 'Numerator: Number of facilities that submitted monthly HMIS reports\r\n\r\nDenominator: Number of facilities expected to submit monthly HMIS reports\r\n', 'DHIS2/HMIS', 'Monthly', 6, 100, 0);
